import React, { useState } from "react";
import emailjs from "emailjs-com";
import "./App.css";
import logo from "./logo.png";
import qr from "./qr.png";

function App() {
  const [formData, setFormData] = useState({
    name: "",
    age: "",
    whatsapp: "",
    email: "",
    topic: "",
    datetime: "",
  });

  const [submitted, setSubmitted] = useState(false);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // 1Ô∏è‚É£ Send confirmation to user
    emailjs
      .send(
        "service_ted5m2h",
        "template_5qmfosa",
        {
          name: formData.name,
          email: formData.email,
        },
        "D8Cr-U9g1MVqsc5bv"
      )
      .then(() => console.log("Confirmation sent"));

    // 2Ô∏è‚É£ Alert admin
    emailjs
      .send(
        "service_ted5m2h",
        "template_nzvxr9o",
        {
          name: formData.name,
          email: formData.email,
        },
        "D8Cr-U9g1MVqsc5bv"
      )
      .then(() => console.log("Alert sent to admin"));

    setSubmitted(true);
  };

  return (
    <div className="font-sans text-white bg-gradient-to-br from-teal-900 to-blue-950 min-h-screen">
      {/* Header / Hero */}
      <header className="flex justify-between items-center px-6 py-8">
        <div>
          <h1 className="text-4xl font-bold">SafeCircle</h1>
          <p className="text-lg mt-1">Your Private Listening Space</p>
        </div>
        <img src={logo} alt="SafeCircle Logo" className="w-20 h-20" />
      </header>

      {/* What We Do */}
      <section className="px-6 py-10 text-center">
        <h2 className="text-3xl font-semibold mb-4">What We Do</h2>
        <ul className="space-y-3 max-w-xl mx-auto text-lg">
          <li>üß† Listen to anything on your mind ‚Äî school, life, overthinking, or just silence.</li>
          <li>ü´Ç Make you feel lighter with calm, honest conversation.</li>
          <li>üå± Give simple guidance or just a space to breathe ‚Äî no pressure.</li>
        </ul>
      </section>

      {/* Why Trust Us */}
      <section className="px-6 py-10 bg-teal-800 text-center">
        <h2 className="text-3xl font-semibold mb-4">Why Trust Us?</h2>
        <ul className="space-y-3 max-w-xl mx-auto text-lg">
          <li>üîí 100% Privacy</li>
          <li>üíñ Compassionate Listeners</li>
          <li>üó£Ô∏è Real Talk</li>
        </ul>
      </section>

      {/* Our Plans */}
      <section className="px-6 py-10 text-center">
        <h2 className="text-3xl font-semibold mb-4">Our Plans</h2>
        <p className="max-w-xl mx-auto text-lg">We offer affordable listening sessions that fit your schedule and emotional needs. Coming soon with flexible packages.</p>
      </section>

      {/* Book a Session */}
      <section className="px-6 py-10 bg-blue-900">
        <h2 className="text-3xl font-semibold text-center mb-6">üìã Book a Session</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6 items-center">
          <form onSubmit={handleSubmit} className="space-y-4">
            <input type="text" name="name" value={formData.name} onChange={handleChange} placeholder="Name" className="w-full p-2 rounded bg-white text-black" required />
            <input type="number" name="age" value={formData.age} onChange={handleChange} placeholder="Age" className="w-full p-2 rounded bg-white text-black" required />
            <input type="text" name="whatsapp" value={formData.whatsapp} onChange={handleChange} placeholder="WhatsApp Number" className="w-full p-2 rounded bg-white text-black" required />
            <input type="email" name="email" value={formData.email} onChange={handleChange} placeholder="Email" className="w-full p-2 rounded bg-white text-black" required />
            <input type="text" name="topic" value={formData.topic} onChange={handleChange} placeholder="Topic / Problem" className="w-full p-2 rounded bg-white text-black" required />
            <input type="datetime-local" name="datetime" value={formData.datetime} onChange={handleChange} className="w-full p-2 rounded bg-white text-black" required />
            <button type="submit" className="bg-teal-600 px-4 py-2 rounded hover:bg-teal-500">Submit</button>
            {submitted && <p className="text-green-300">Session booked! We‚Äôll contact you soon.</p>}
          </form>
          <img src={qr} alt="QR for Payment" className="max-w-xs mx-auto rounded-lg shadow-lg" />
        </div>
      </section>

      {/* Testimonials */}
      <section className="px-6 py-10 text-center">
        <h2 className="text-3xl font-semibold mb-4">What People Say</h2>
        <div className="space-y-6 max-w-3xl mx-auto">
          <blockquote className="italic">‚ÄúTalking to someone who listens without judgment helped me breathe again.‚Äù</blockquote>
          <blockquote className="italic">‚ÄúI felt safe, heard, and understood. Thank you for this space.‚Äù</blockquote>
          <blockquote className="italic">‚ÄúDidn‚Äôt think I'd cry in a good way. So calming and kind.‚Äù</blockquote>
        </div>
      </section>

      {/* FAQ */}
      <section className="px-6 py-10 bg-teal-800 text-white">
        <h2 className="text-3xl font-semibold mb-6 text-center">FAQs</h2>
        <div className="space-y-4 max-w-3xl mx-auto">
          <div>
            <h3 className="font-bold">Q: Is my session really private?</h3>
            <p>A: Absolutely. Nothing is recorded or shared. 100% privacy is guaranteed.</p>
          </div>
          <div>
            <h3 className="font-bold">Q: What can I talk about?</h3>
            <p>A: Anything ‚Äî stress, family, school, overthinking, silence. We‚Äôre here to listen.</p>
          </div>
          <div>
            <h3 className="font-bold">Q: How will I be contacted?</h3>
            <p>A: Via WhatsApp at your preferred date and time.</p>
          </div>
        </div>
      </section>

      {/* CTA */}
      <section className="px-6 py-10 text-center">
        <h2 className="text-3xl font-semibold mb-4">Still have questions?</h2>
        <p className="mb-4">Reach out to us ‚Äî we‚Äôll respond with care.</p>
